__NUXT_JSONP__("/drugs/Iodine_I_131_MIP-1095", (function(a,b,c,d){return {data:[{drug:{slug:b,emaEpar:[],fdaDrugLabel:[],id:b,nciThesaurus:{casRegistry:a,chebiId:a,chemicalFormula:a,definition:"A radioconjugate composed of MIP-1095, a urea-based ligand for the tumor-associated antigen (TAA) prostate-specific membrane antigen (PSMA) radiolabeled with iodine I 131 (I131), with potential antineoplastic activity. Upon administration of iodine I 131 MIP-1095, the MIP-1095 moiety selectively targets and binds to the extracellular domain of PSMA, thereby delivering cytotoxic iodine I 131 specifically to PSMA-expressing cancer cells. PSMA is a transmembrane glycoprotein that is highly expressed by malignant prostate epithelial cells and certain other tumor cells.",fdaUniiCode:"7DM27RQ9V0",identifier:"C131821",preferredName:c,semanticType:"Pharmacologic Substance",subclassOf:["C129819","C2124"],synonyms:["((S)-2-(3-((S)-1-carboxy-5-(3-(4-[(131)I]iodophenyl)ureido)pentyl)ureido)pentanedioic Acid","(131) I-MIP-1095","131I-MIP-1095","I-131 MIP-1095",c,"MIP-1095 I-131"]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FIodine_I_131_MIP-1095",extension:".json",createdAt:d,updatedAt:d}}],fetch:{},mutations:void 0}}("","Iodine_I_131_MIP-1095","Iodine I 131 MIP-1095","2021-10-30T13:31:28.353Z")));